Capital Resources shall receive the following compensation for its services hereunder:

                  (a) (i) a  marketing  fee in the  amount  of (x)  two  percent (2.0%) of the aggregate dollar amount of all Shares sold in the Subscription and Public Offerings,  excluding sales made through broker assisted  purchases or by other NASD member firms  participating  in the Subscription and Public Offerings pursuant  to  the  Selected  Dealers'  Agreement,  if  any  (for  which  Capital Resources'  compensation shall be pursuant to sub-paragraph  (ii)) and excluding shares sold to the  Association's  Employee  Stock  Ownership  Plan,  directors, officers or employees and any member of such person's  immediate family (defined to include children, spouse, parents, grandparents and grandchildren);

                           (ii)    a management fee in the amount of one percent and one-half (1.5%) of the aggregate dollar amount of Shares sold through broker assisted  purchases or through selected dealers, if any.

Smith hereby grants to TDA the following rights (the "Rights"):

            (a) the right to use and reuse Smith's name, voice, likeness,       facsimile signature, personal statistics, biographical information and any       reproduction or simulation thereof ("Smith's Likeness") in TDA's Golf       Instruction Related Products and on packaging for TDA's Golf Instruction       Related Products in any fashion, said grant of rights being limited to the       world (the "Contract Territory")";

            (b) the right to use and reuse Smith's Likeness in TDA's general       internal, non-public corporate promotional materials (such as TDA's Annual       Report), corporate advertising and in other forms of publicity;

            (c) the right to use and reuse Smith's Likeness in and in connection       with the marketing, advertising, promoting and publicizing of TDA's Golf       Instruction Related Products, by any and all means now known or hereafter       developed;

            (d) the exclusive right to use and reuse the results and proceeds of       the in connection with TDA's Golf Instruction Related Products; and

            (e) with Smith's prior reasonable approval, the right to license to       third parties any of the foregoing rights but only in connection with or       directly related to the marketing and sale of TDA's Golf Instruction       Related Products.

(1) in the event the Agreement is effectively terminated by either Monsanto or its successor or by the Agent upon Material Breach, Material Fraud or Material Willful Misconduct by Monsanto as provided for in Section 10.5.(c);

(2) no later than the effective date of the applicable termination notice and no later than the effective date of the termination; and

(3) only in the event the Agent does not become the successor to the Roundup Business, in which case the Termination Fee shall not be paid but shall be credited against the purchase price as described in Section 10.4(d).
